            background-color: #2980b9
        }

        .df-hide {
            position: absolute;
            top: 10px;
            right: 13px;
            font-size: 13px;
            color: #333333;
            cursor: pointer;
            transition: color .17s ease
        }

        .rtl .df-hide {
            right: unset;
            left: 13px
        }

        .df-hide:hover {
            color: #e74c3c
        }

        @media (max-width: 880px) {
            .demo-float {
                display: none
            }
        }
